import React, { useState } from 'react';
import './css/NavigationBarTop.css';

function NavigationBarTop() {
    const [language, setLanguage] = useState('EN');
    const [isDropdownVisible, setDropdownVisible] = useState(false);

    const signIn = () => {
        console.log("Sign in clicked");
    };

    const signOut = (event) => {
        event.stopPropagation();
        console.log("Sign out clicked");
    };

    const toggleDropdown = (event) => {
        event.stopPropagation();
        setDropdownVisible(!isDropdownVisible);
    };

    const updateLanguage = (newLanguage, event) => {
        event.stopPropagation();
        setLanguage(newLanguage);
    };

    return (
        <div className="navigation-bar-top">
            {/* Search box */}
            <div className="search-container">
                <div className="info-panels">
                    <div className="input-color-group-one">
                        <input className="search-input" autocomplete="on" name="text" type="text" required placeholder="Rapunga / Search" />
                        <label className="search-label">Search</label>
                        <button className="search-button">
                            <svg fill="white" width="15px" height="15px" viewBox="0 0 1920 1920" xmlns="http://www.w3.org/2000/svg">
                                <path d="M790.588 1468.235c-373.722 0-677.647-303.924-677.647-677.647 0-373.722 303.925-677.647 677.647-677.647 373.723 0 677.647 303.925 677.647 677.647 0 373.723-303.924 677.647-677.647 677.647Zm596.781-160.715c120.396-138.692 193.807-319.285 193.807-516.932C1581.176 354.748 1226.428 0 790.588 0S0 354.748 0 790.588s354.748 790.588 790.588 790.588c197.647 0 378.24-73.411 516.932-193.807l516.028 516.142 79.963-79.963-516.142-516.028Z" fill-rule="evenodd"></path>
                            </svg>
                        </button>
                    </div>
                </div>
            </div>

            {/* Sign in */}
            <div className="login-container" onClick={signIn}>
                <div className="sign-icon">
                    <i className="fa fa-user-circle-o" style={{ fontSize: "30px" }}></i>
                </div>
                <div className="sign-text">Sign In</div>
            </div>

            {/* Sign in content */}
            <div className="sign-in-content">
                <div className="content-section" id="show-name">Hi Song Han</div>
                <hr className="divider" />
                <div className="content-section" id="change-password">Change Password<i className="fa fa-chevron-right fa-right"></i></div>
                <hr className="divider" />
                <div className="content-section" id="edit-profile">Edit Profile<i className="fa fa-chevron-right fa-right"></i></div>
                <hr className="divider" />
                <div className="content-section" style={{ height: "50px", justifyContent: "center", alignContent: "center" }}>
                    <button type="button" title="Sign out" className="sign-out-button sign-out-button-color sign-out-button-background-color" onClick={signOut}>
                        <span>Sign Out &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<i className="fa fa-chevron-right"></i></span>
                    </button>
                </div>
                <div className="content-triangle"></div>
            </div>

            {/* Language change */}
            <div className="language-change" onClick={toggleDropdown}>
                <span id="selected-language">{language}</span>
                <span className="dropdown-arrow"><i className="fa fa-caret-down" style={{ fontSize: "20px", paddingLeft: "5px" }}></i></span>
                <ul id="language-options" className={isDropdownVisible ? '' : 'hidden'}>
                    <li onClick={(e) => updateLanguage('EN', e)}>English</li>
                    <li onClick={(e) => updateLanguage('CN', e)}>Chinese</li>
                    <li onClick={(e) => updateLanguage('ES', e)}>Spanish</li>
                    <li onClick={(e) => updateLanguage('FR', e)}>French</li>
                    <li onClick={(e) => updateLanguage('DE', e)}>German</li>
                </ul>
            </div>
        </div>
    );
}

export default NavigationBarTop;
